  return (
    <div className="App">
      <div className="hud">
        <div classname="display-name" >
          <DisplayName userName={this.props.Profile.userName} />
        </div>
        <div classname="win-display">
          <WinDisplay wins={this.state.userWins} />
        </div>
        <div cclassname="health-bar">
          <HealthBar health={this.state.uSpirit} />
        </div>
      </div>



    </div>
  );
}

export default App;
